    <text

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:10px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text390"><tspan
         x="0 5.5599999 11.67 17.23 22.790001 25.57 28.629999 37.52 43.080002 49.189999 52.25 58.360001 63.360001 69.470001 75.580002 81.139999 83.919998 86.699997 92.809998 95.870003 99.760002 105.32 109.21 111.99 117.55 123.66 129.77 132.55 135.33 141.44 144.5 153.39 156.17 162.28 166.17 169.23 172.00999 175.07001 181.17999 186.74001 192.85001"
         y="0"
         id="tspan350">Enkel men hyggelig feriebolig midt i den </tspan><tspan
         x="0 3.8900001 7.7800002 13.34 22.23 28.34 31.120001 37.23 43.34 47.23 51.119999 57.23 60.009998 66.120003 71.68 74.739998 80.849998 86.410004 95.300003 98.080002 103.64 106.7 110.59 116.15 118.93 125.04 131.14999 136.71001 140.60001 146.71001 150.97 153.75 156.81 162.37 166.25999 169.32001 174.88 180.99001 187.10001 192.66 198.22 202.11 205.17 209.06 211.84 214.62"
         y="12"
         id="tspan352">stemningsfulde gamle skipperby, et anneks til </tspan><tspan
         x="0 6.1100001 12.22 15 20.559999 23.34 28.9 32.790001 36.68 39.740002 45.849998 50.849998 56.959999 63.07 66.959999 69.739998 72.800003 80.019997 85.580002 88.360001 91.139999 93.919998 100.03 103.09 105.87 111.98 117.54 123.1 128.66 132.55 135.61 141.72 147.28 152.28 157.84 160.62 163.67999 167.57001 173.67999 182.57001 185.63 191.74001 197.3 200.08 205.64 209.53"
         y="24"
         id="tspan354">udlejers byhus. Dejlig lukket have, som deles </tspan><tspan
         x="0 8.8900003 14.45 20.559999 23.620001 29.73 35.84 38.619999 44.18 46.959999 52.52 55.492001 58.271999 61.332001 68.001999 74.112 80.222 83.281998 87.171997 92.732002 95.792 104.682 107.462 113.572 119.682 123.572 127.462 133.022 136.912 140.802 143.862 149.972 155.532 161.642 167.752 170.812 174.702 177.48199 180.26199 183.32201 188.882 194.442 200.552 206.112 208.892 211.672"
         y="36"
         id="tspan356">med udlejer. Kun få minutters gang til kanal, </tspan><tspan
         x="0 6.1100001 11.67 16.67 22.780001 25.84 31.950001 38.060001 41.119999 47.23 52.790001 58.900002 64.459999 68.349998 72.239998 76.129997 81.690002 87.800003 93.910004 96.690002 99.75 106.97 113.08 116.14 121.7 127.26 133.37 136.42999 139.21001 144.77 150.33 155.89 158.95 162.84 168.39999 171.46001 177.57001 183.13 188.13 193.69 197.58 200.64 204.53 208.42 213.98"
         y="48"
         id="tspan358">havn og badestrand. Du kan ikke se havet fra </tspan><tspan
         x="0 6.1100001 12.22 16.110001 21.67 25.559999 28.34 31.4 40.290001 45.849998 51.959999 55.02 61.130001 67.239998 70.300003 75.860001 81.419998 87.529999 90.589996 96.699997 102.81 106.7 112.26 115.32 121.43 126.99 130.88 133.66 136.72 141.72 145.61 151.72 157.28 160.06 163.12 167.00999 173.12 178.12 183.67999 188.67999 197.57001 200.54201 203.32201 206.382 215.272 218.052"
         y="60"
         id="tspan360">huset, men du kan høre det. Stue, sovevær. m. </tspan><tspan
         x="0 6.1100001 12.22 18.33 24.440001 30 32.779999 36.669998 40.560001 46.119999 52.23 58.34 61.119999 64.18 70.290001 75.849998 84.739998 88.629997 91.690002 100.58 106.14 112.25 115.31 124.2 129.75999 135.87 139.75999 145.32001 149.21001 153.10001 158.66 162.55 165.61 171.72 177.28 180.34 186.45 192.56 195.34 200.34 205.89999 209.78999 212.57001"
         y="72"
         id="tspan362">dobbeltseng, hems med madrasser på gulvet, </tspan><tspan
         x="0 6.1100001 11.67 14.45 17.23 20.01 26.120001 30.01 33.07 39.18 44.740002 50.849998 56.41 60.669998 63.450001 66.510002 70.400002 75.959999 84.849998 88.739998 91.800003 97.360001 103.47 109.03 114.59 120.15 126.26 129.03999 132.10001 139.32001 142.10001 145.99001 149.05 155.16 161.27 165.16 169.05 174.05 177.022 179.802 182.862 185.642 191.752 197.312 200.092 202.87199 205.93201 214.26199 217.04201 220.37199 224.26199 227.04201"
         y="84"
         id="tspan364">dejligt badev. samt køkken. Alt udstyr, inkl. wi-fi </tspan><tspan
         x="0 6.1100001 12.22 15.28 20.84 26.4 32.509998 38.07 40.849998 44.18 48.07 52.330002 55.110001 58.169998 65.389999 70.949997 75.949997 81.510002 90.400002 96.510002 102.62 105.4 110.96 113.931 116.711 119.771 126.991 132.55099 136.44099 139.50101 145.061 148.951 152.011 155.901 159.791 165.351 171.461 174.241 177.30099 181.19099 187.30099 190.36099 196.47099 202.58099 205.64101 208.42101 214.53101 219.53101 222.311 225.091"
         y="96"
         id="tspan366">og kabel-tv. Havemøbler. Her er fred, ro og idyl, </tspan><tspan
         x="0 8.8900003 14.45 20.559999 23.620001 29.18 35.290001 41.400002 44.459999 50.02 53.91 56.970001 63.080002 68.639999 72.529999 75.589996 81.699997 87.809998 93.919998 100.03 103.92 109.48 115.59 121.15 124.21 133.10001 138.66 142.55 148.11 152 155.06 160.06 168.95 174.50999 177.57001 181.46001 184.24001 190.35001 196.46001 202.02 205.91 208.97 215.08 221.19"
         y="108"
         id="tspan368">men kun et par hundrede meter væk finder du </tspan><tspan
         x="0 3.8900001 9.4499998 13.34 17.23 22.790001 28.9 32.790001 38.349998 44.459999 48.349998 53.91 57.799999 60.860001 66.970001 73.080002 76.139999 82.25 88.360001 92.25 95.029999 100.59 106.15 111.71 114.682 117.462 120.522 126.632 132.742 136.632 139.692 143.582 146.362 149.142 152.202 159.422 168.312 172.202 176.092 181.092 186.65199 192.76199 195.82201 201.93201 206.93201 212.492 216.382"
         y="120"
         id="tspan370">restauranter og butikker. Bus til Næstved hver </tspan><tspan
         x="0 6.1100001 11.67 14.45 19.450001 25.01 28.07 31.959999 34.740002 43.630001 49.189999 51.970001 55.029999 62.810001 68.919998 71.699997 77.260002 82.260002 85.32 91.43 96.989998 100.88 103.94 112.83 118.94 122.83 128.39 131.17 134.23 138.12 142.00999 147.57001 153.67999 156.46001 162.57001 165.63 171.19 176.75 180.64 183.42 187.31 191.2 196.75999 200.64999 206.21001 212.32001 218.42999 223.99001"
         y="132"
         id="tspan372">halve time. Oplev det ægte, stadig eksisterende </tspan><tspan
         x="0 6.1100001 12.22 18.33 24.440001 30.549999 36.110001 40 46.110001 50 53.889999 56.669998 60.560001 66.120003 71.68 80.57 83.349998 86.129997 88.910004 95.019997 98.080002 104.19 109.75 113.64 116.7 119.48 122.54 129.21001 134.77 138.66 142.55 148.11 154.22 163.11 168.67 172.56 181.45 184.23 190.34 196.45 202.00999 204.78999"
         y="144"
         id="tspan374">bundgarnsfiskemiljø her i Karrebæksminde, </tspan><tspan
         x="0 6.1100001 12.22 15.28 19.17 25.280001 28.059999 31.950001 35.009998 41.119999 43.900002 50.009998 53.07 61.959999 70.849998 74.739998 77.800003 80.580002 83.639999 87.529999 93.639999 99.75 105.31 111.42 116.98 120.04 126.15 132.25999 135.32001 139.21001 143.10001 148.66 154.77 158.66 164.22 167.28 172.84 175.62 178.67999 182.57001 185.35001 188.13"
         y="156"
         id="tspan376">og spis dig mæt i røgede og stegte ål til </tspan><tspan
         x="0 6.1100001 11.11 16.67 20.559999 26.120001 32.23 41.119999 50.009998 55.57 58.349998 61.130001 67.239998 72.800003 75.860001 81.970001 85.860001 88.639999 92.529999 98.089996 101.062"
         y="168"
         id="tspan378">overkommelige priser.</tspan><tspan
         x="0 6.6700001 9.4499998 12.23 17.790001 20.85 26.959999 32.52 36.41 39.470001 43.360001 49.470001 53.360001 56.419998 61.98 65.870003 68.93 72.82 75.599998 81.160004 86.720001 92.279999 97.839996 100.9 106.46 112.57 115.35 120.35 125.91 132.02 135.08 141.19 147.3 150.36 155.36 160.92 168.14 170.92 178.14 183.7 186.75999 193.98 201.2 206.75999 212.87 215.92999 218.71001"
         y="192"
         id="tspan380">Klik her for at tjekke PRISER og LEDIGE UGER i </tspan><tspan
         x="0 6.1100001 10 12.78 16.67 22.23 27.790001 30.57 36.130001 42.240002 48.349998 53.91 57.799999 63.360001 69.470001 73.360001"
         y="204"
         id="tspan382">priskalenderen! </tspan><tspan
         x="0 9.4399996 15.55 21.66 25.549999 31.110001 37.220001 40.279999 46.389999 52.5 56.389999 61.950001 64.730003 70.290001 74.18 79.739998 85.849998 89.739998 92.800003 96.690002 99.470001 103.36 106.14 108.92 117.81 123.37 126.15 128.92999 131.71001 137.82001 140.60001 146.16 155.05 163.94 169.5 173.39 176.17 182.28 187.84 190.89999 195.89999 198.96001 205.07001 211.17999 215.07001 220.07001 222.85001 228.96001"
         y="216"
         id="tspan384">Modtag husejerens tlf./mail/hjemmeside – udfyld </tspan><tspan
         x="0 5.5599999 11.67 17.780001 21.67 27.23 32.790001 36.68 40.57 46.68 50.57 59.459999 65.57 68.349998 73.910004 77.800003 83.360001 89.470001"
         y="228"
         id="tspan386">kontaktformularen!</tspan><tspan
         x="0 8.3299999 16.66 24.440001 27.219999 31.110001 37.220001 46.110001 55 60.560001 64.449997 70.559998 76.669998 80.559998 86.669998 92.230003 98.339996 107.23 112.79 116.68 122.24 125.02 131.13 136.69"
         y="240"

         y="26"
         id="tspan122">havet og markerne er indhyllet i det helt unikke </tspan><tspan
         x="0 2.78 7.7800002 11.67 14.45 17.51 26.4 31.959999 38.07 41.130001 46.689999 52.799999 58.91 61.970001 65.860001 68.639999 74.75 80.860001 86.419998 90.309998 93.370003 96.150002 99.209999 105.32 110.88 114.77 117.83 123.94 130.05 133.94 140.05 142.83 145.61 151.72 157.28 160.34 167.56 173.12 179.23 188.12 193.67999 197.57001 203.13 205.91 208.97 213.78999 219.35001 225.46001"
         y="39"
         id="tspan124">lys, man kun finder i det nordlige Danmark. Tag </tspan><tspan
         x="0 5.5599999 11.67 14.73 20.84 25.84 31.950001 35.009998 37.790001 43.900002 50.009998 55.57 61.68 67.790001 70.57 76.68 82.790001 85.57 88.629997 94.739998 100.85 103.91 110.02 115.02 121.13 124.19 128.08 133.08 139.19 144.75 148.64 151.7 157.25999 161.14999 164.21001 171.42999 177.53999 181.42999 187.53999 193.64999 199.21001 205.32001 214.21001 219.77 223.66 229.22 232"
         y="52"
         id="tspan126">en dyb indånding, og nyd synet af Norddanmark, </tspan><tspan
         x="0 3.8900001 9.4499998 12.51 15.29 20.85 26.959999 33.07 36.959999 40.02 46.130001 48.91 54.470001 58.360001 61.419998 65.309998 74.199997 79.760002 85.32 90.879997 93.850998 96.630997 99.691002 102.471 105.531 109.421 114.981 118.871 121.931 128.041 133.601 138.601 144.161 148.05099 150.83099 153.89101 160.00101 165.561 169.451 172.511 175.291 181.401 187.511 193.621 198.621 204.731 210.291 214.181 217.241 221.131 223.911 226.69099"
         y="65"
         id="tspan128">så langt øjet rækker. I ser havet, der indbyder til </tspan><tspan
         x="0 5.5599999 11.67 14.73 20.290001 24.18 29.74 35.849998 38.630001 44.189999 50.299999 56.41 61.970001 65.029999 71.139999 77.25 82.809998 88.370003 93.93 97.82 101.71 104.77 107.55 110.61 116.72 122.28 126.17 129.23 133.12 135.89999 141.46001 145.35001 151.46001 157.02"
         y="78"
         id="tspan130">en afkølende dukkert i det fjerne.</tspan></text>

    <text

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:10px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text156"><tspan
         x="0 2.78 5.8400002 10.28 15.28 20.84 23.620001 29.18 33.07 36.130001 45.02 50.580002 56.689999 59.75 64.75 70.309998 76.419998 82.529999 88.089996 91.980003 95.040001 98.93 105.04 113.93 116.99 120.88 126.99 129.77 135.88 141.44 145.33 150.33 155.89 162 168.11 171.17 173.95 179.50999 185.62 191.73 195.62 198.67999 204.24001 209.8 212.771 215.55099"
         y="0"
         id="tspan138">I cykler med vandet som følgesvend langs åer, </tspan><tspan
         x="0 3.8900001 10 15.56 19.450001 22.51 28.620001 34.73 37.790001 43.900002 47.790001 53.900002 59.459999 63.349998 66.410004 72.519997 78.629997 81.690002 87.25 92.809998 98.919998 101.98 110.87 116.43 122.54 125.6 128.38 137.27 142.27 148.38 153.94 157 165.89 171.45 174.23 177.00999 182.57001 191.46001 195.35001 201.46001 210.35001"
         y="13"
         id="tspan140">søer og broer og kan med jævne mellemrum </tspan><tspan
         x="0 3.8900001 9.4499998 12.51 15.29 18.07 23.07 28.629999 32.52 35.580002 41.689999 47.799999 53.91 59.470001 63.360001 66.419998 71.419998 76.980003 83.089996 89.199997 95.309998 100.31 105.87 109.76 113.65 116.43 121.99 128.10001 133.66 139.77 142.83 146.72 149.5 153.39 157.28 162.84 165.89999 172.00999 178.12 180.89999 183.96001 188.78 194.34 200.45 203.50999 209.07001 212.96001"
         y="26"
         id="tspan142">se livet under vandoverfladen titte op. Tag et </tspan><tspan
         x="0 6.1100001 15 18.889999 27.780001 33.34 37.23 42.790001 45.849998 51.41 54.189999 60.299999 63.360001 69.470001 75.029999 78.089996 84.199997 89.199997 95.309998 101.42 106.98 111.98 115.87 119.76 122.54 126.43 131.99001 137.55 143.66 149.22 152.28 156.17 160.06 165.62 168.67999 173.67999 179.24001 184.8 190.91 196.47 200.36 204.25 209.81 215.37 219.25999"
         y="39"
         id="tspan144">nærmere kig på dybhavsfiskene fra Skagerraks </tspan><tspan
         x="0 8.8900003 15 18.889999 24.450001 30.01 33.07 39.18 44.18 50.290001 53.349998 56.130001 59.189999 66.410004 72.519997 76.410004 82.519997 86.410004 92.519997 98.080002 104.19 107.25 115.03 119.47 125.03 130.59 136.7 142.25999 146.14999 148.92999 155.03999 163.92999 166.71001 169.77 177.55 183.66 186.44 192 197 200.06 202.84 205.62 210.62 216.17999 220.07001"
         y="52"
         id="tspan146">mørke dyb i Nordsøen Oceanarium. Oplev livet </tspan><tspan
         x="0 6.1100001 11.67 14.73 20.84 26.4 31.4 37.509998 43.07 49.18 51.959999 55.02 61.130001 66.690002 70.580002 73.639999 77.529999 80.309998 84.199997 89.760002 95.32 99.209999 105.32 110.88 116.99 122.55 128.66 134.22 137.28 140.06 145.62 151.73 157.84 163.39999 167.28999 170.35001 176.46001 182.02 185.91 191.47 195.36 198.42 202.31 207.87 213.98 220.09 223.98 227.87 230.64999"
         y="65"
         id="tspan148">på havnen, når fiskerbådene lander deres fangst. </tspan><tspan
         x="0 5 10.56 16.67 22.780001 25.84 29.73 32.509998 36.400002 41.959999 45.02 48.91 52.799999 58.360001 61.419998 65.309998 69.199997 73.089996 78.650002 84.760002 90.870003 96.43 102.54 105.6 111.16 113.94 116.72 122.28 126.17 129.23 132.00999 135.07001 140.63 146.19 152.3 155.08 158.14 164.25 170.36 173.42 179.53 184.53 190.64 193.7 196.48 202.03999 205.92999 211.49001 215.38"
         y="78"
         id="tspan150">Fang fisk fra stranden eller i åen, og nyd jeres </tspan><tspan
         x="0 5.5599999 11.67 17.23 23.34 26.4 30.290001 35.849998 41.959999 48.07 51.959999 55.849998 58.91 61.689999 64.75 70.860001 76.419998 80.309998 86.419998 90.309998 95.870003 101.98 104.76 107.82 113.38 116.16 118.94 124.5 128.39 131.45 137.56 143.12 147.00999 150.89999 153.67999 156.46001 159.52 163.41 167.3 170.08 173.97 179.53 183.42 188.98 195.09 201.2 206.75999 210.64999 213.71001 217.60001 220.38 224.27 229.83"
         y="91"
         id="tspan152">egen fangst i naturen. Eller bestil friskfanget fisk </tspan><tspan
         x="0 3.8900001 7.7800002 13.34 16.4 21.959999 25.85 28.91 34.470001 38.360001 41.419998 50.310001 55.869999 61.98 68.089996 73.650002 79.760002 83.650002 87.540001 93.099998 99.209999 104.77 107.83 110.61 113.67 117.56 120.34 124.23 129.78999 135.35001 139.24001 145.35001 150.35001 155.91 162.02 165.08 172.3 175.08 178.97 182.86 186.75 192.86 198.42 201.2 205.09"
         y="104"
         id="tspan154">fra et af menukortene i fiskerbyen Hirtshals.</tspan></text>

    <text
       xml:space="preserve"

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:10px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text178"><tspan
         x="0 2.78 5.8400002 10.28 15.28 20.84 23.620001 29.18 33.07 36.130001 42.240002 47.799999 50.860001 56.970001 62.529999 66.419998 69.199997 72.260002 78.370003 83.93 87.82 90.879997 94.769997 97.550003 103.66 106.44 109.22 115.33 120.89 124.78 130.34 133.39999 138.39999 143.96001 147.85001 150.91 157.02 162.58 167.58 173.69 179.8 185.91 192.02 194.8 197.86 201.75 207.86 211.75 217.86 220.64"
         y="0"
         id="tspan162">I cykler på det, der tidligere var havbund, forbi </tspan><tspan
         x="0 8.8900003 15 18.889999 24.450001 28.34 31.4 37.509998 43.619999 46.68 50.57 56.130001 59.189999 65.300003 70.860001 74.75 80.860001 83.832001 86.612 89.671997 95.781998 100.782 106.892 110.782 113.842 122.732 128.29201 134.40199 137.46201 143.57201 149.132 153.022 156.082 161.642 170.532 179.422 185.532 191.092 194.98199 198.04201 203.60201 209.71201"
         y="13"
         id="tspan164">moser og rå natur, hvor man har kæmpet en </tspan><tspan
         x="0 5.5599999 11.12 20.01 26.120001 29.18 33.07 39.18 43.07 46.130001 51.689999 55.580002 58.639999 64.75 67.529999 73.089996 79.199997 83.089996 88.650002 91.709999 95.599998 99.489998 108.38 113.94 117.83 120.89 127 133.11 136.17 141.73 145.62 151.73 155.62 161.73 167.84 173.39999 176.37199 179.15199 182.21201 184.992 188.052 194.162 199.722 203.612 207.502 213.062 216.12199 220.01199 225.57201"
         y="26"
         id="tspan166">kamp for at plante træer og afgrøder. I dette rå </tspan><tspan
         x="0 2.78 8.3400002 14.45 20.559999 24.450001 30.01 35.57 41.68 44.740002 48.630001 54.189999 58.080002 61.139999 63.919998 66.699997 69.760002 75.870003 80.870003 86.980003 90.870003 96.980003 102.54 108.65 111.71 117.82 123.38 126.44 129.22 135.33 140.89 146.45 149.23 154.78999 157.85001 160.63 166.74001 172.3 178.41 184.52 190.08 198.97 202.03 205.92 208.7 214.81 220.37 226.48"
         y="39"
         id="tspan168">landskab ser I, hvordan de lokale igennem tiden </tspan><tspan
         x="0 6.1100001 12.22 15.28 19.17 23.059999 28.620001 37.509998 40.57 44.459999 47.240002 50.02 53.080002 55.860001 58.919998 65.029999 70.589996 76.699997 79.760002 82.540001 91.43 97.540001 103.65 106.71 112.27 115.05 117.83 123.39 126.45 132.56 138.67 144.78 148.67 151.73 157.84 163.39999 167.28999 170.35001 174.24001 180.35001 184.24001 193.13 198.69 204.25 208.14 211.2 216.75999 220.64999"
         y="52"
         id="tspan170">og frem til i dag imod alle odds har formået at </tspan><tspan
         x="0 6.1100001 12.22 18.33 23.33 27.219999 31.110001 36.669998 39.73 45.84 51.400002 55.290001 61.400002 65.290001 70.849998 76.959999 80.019997 83.910004 86.690002 89.470001 92.529999 98.089996 101.98 105.04 111.15 117.26 122.26 125.04 131.14999 137.25999 142.82001 145.88 149.77 155.88 159.77 164.77 167.83 170.61 173.67 182.56 188.67 192.56 198.12 202.00999 208.12 213.67999 216.46001"
         y="65"
         id="tspan172">udnytte naturen til at udvinde tørv i moserne, </tspan><tspan
         x="0 6.1100001 10 16.110001 22.219999 28.33 32.77 38.330002 42.220001 47.779999 50.84 54.73 60.290001 63.07 66.959999 70.019997 76.129997 82.239998 85.300003 90.860001 96.970001 103.08 109.19 114.75 117.81 123.92 130.03 136.14 141.14 146.7 149.75999 155.87 161.42999 165.32001 171.42999 175.32001 184.21001 189.77 195.88 198.66 203.10001 205.88 211.99001 214.77"
         y="78"
         id="tspan174">producere salt og endda udøve naturmedicin. </tspan><tspan
         x="0 7.2199998 13.33 19.440001 22.5 28.059999 31.950001 35.009998 39.450001 44.450001 50.009998 52.790001 58.349998 64.459999 67.519997 71.410004 77.519997 81.410004 84.470001 90.029999 96.139999 99.199997 103.09 106.98 113.09 119.2 125.31 128.09 131.14999 137.25999 143.37 146.42999 152.53999 158.64999 162.53999 165.60001 171.71001 174.49001 178.38 182.27 188.38 192.27 195.05 200.61 204.5 210.61 216.17"
         y="91"
         id="tspan176">Hop af cyklen for en stund, og hør historierne.</tspan></text>

       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"

         x="0 7.3319998 14.664 19.332001 26.004 29.676001 36.348 43.02 46.355999 50.028 58.692001 62.028 69.360001 80.028 86.699997 90.372002 96.372002 100.044 108.708 116.04 119.376 124.704 128.03999 135.37199"

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,330.2263,715.9153)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:10px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text250"><tspan
         x="0 2.78 5.8400002 11.95 17.51 21.4 24.459999 30.57 36.130001 38.91 42.799999 45.860001 49.75 58.639999 62.529999 65.309998 68.089996 74.199997 79.760002 82.82 88.93 95.040001 98.93 105.04 107.82 110.6 116.71 122.27 125.33 128.11 133.11 137 140.06 144.5 149.5 155.06 157.84 163.39999 167.28999 170.35001 173.13 176.19 182.3 187.86 190.92 194.81 200.92 207.03 213.14 218.7 224.81"
         y="0"
         id="tspan236">I det helt særlige nordlige lys cykler I på toppen </tspan><tspan
         x="0 5.5599999 9.4499998 12.51 19.73 25.290001 31.4 40.290001 45.849998 49.740002 55.299999 58.360001 64.470001 70.029999 76.139999 82.25 87.809998 96.699997 99.760002 103.65 109.76 114.76 118.65 124.76 130.87 133.64999 139.21001 145.32001 150.88 154.77 157.83 161.72 164.5 170.61 176.17 178.95 182.00999 189.23 194.78999 198.67999 201.74001 207.3 211.19 214.25 220.36 225.92 228.7 232.59"
         y="13"
         id="tspan238">af Danmark gennem rovfuglenes rige. Her er helt </tspan><tspan
         x="0 3.8900001 6.6700001 12.23 18.34 22.23 25.01 28.07 36.959999 42.52 48.630001 51.689999 57.799999 63.360001 66.419998 72.529999 75.309998 84.199997 86.980003 92.540001 98.650002 101.71 107.82 112.82 118.38 122.27 125.33 128.11 133.67 137.56 140.62 144.50999 149.50999 158.39999 163.39999 168.96001 172.85001 175.91 181.47 187.58 193.69 199.8 205.36 211.47 215.36 221.47 227.03 229.81"
         y="26"
         id="tspan240">fladt, men på himlen over jer svæver kongeørne, </tspan><tspan
         x="0 6.1100001 11.67 16.67 22.780001 26.67 32.779999 38.34 41.400002 47.509998 53.619999 56.68 65.57 71.68 75.57 80.57 86.129997 92.239998 97.800003 101.69 104.75 108.64 114.75 118.64 121.7 127.26 133.37 139.48 145.03999 151.14999 157.25999 160.32001 163.10001 171.99001 177.55 180.33 183.11 188.67 197.56 200.62 206.17999 210.07001"
         y="39"
         id="tspan242">havørne og musvåger for engang imellem at </tspan><tspan
         x="0 6.1100001 11.11 16.67 22.23 27.790001 30.85 36.959999 42.52 48.630001 51.689999 54.470001 57.529999 60.310001 65.870003 71.980003 78.089996 81.980003 87.540001 93.099998 99.209999 104.77 108.66 111.72 117.83 123.94 127 130.89 136.45 142.56 148.67 154.23 157.28999 162.85001 168.96001 172.02 175.91 182.02 188.13 190.91 193.69 196.75 202.31 208.42"
         y="52"
         id="tspan244">dykke ned i landskabet og fange en fugl, en </tspan><tspan
         x="0 3.8900001 6.6700001 10.56 16.120001 18.9 21.959999 27.52 31.41 34.470001 40.029999 43.919998 48.919998 55.029999 61.139999 66.139999 70.029999 73.089996 78.650002 81.43 84.209999 89.769997 93.660004 96.720001 102.28 108.39 111.45 117.56 123.12 127.01 132.57001 135.35001 138.41 143.41 147.3 153.41 159.52 162.58 168.14 172.03 175.09 181.2 183.98 189.53999 195.64999 198.42999 201.21001 206.77 209.55 212.61 218.72 224.83"
         y="65"
         id="tspan246">fisk, et krybdyr eller en hare. Stop et øjeblik, og </tspan><tspan
         x="0 6.1100001 11.67 15.56 19.450001 25.01 31.120001 35.009998 38.07 44.18 49.740002 52.799999 61.689999 67.25 70.029999 75.589996 79.480003 83.370003 92.260002 96.150002 98.93 102.82 108.38 113.94 117 120.89 127 133.11 135.89 141.45 144.50999 150.62 155.62 161.17999 165.07001 168.13 170.91 176.47 179.442"
         y="78"
         id="tspan248">betragt de majestætiske fugle over jer.</tspan></text>

    <text

       id="text270"><tspan
         x="0 4.8200002 10.38 16.49 19.549999 25.66 31.77 35.66 41.77 44.830002 50.939999 57.049999 60.110001 65.110001 71.220001 76.779999 80.669998 86.779999 92.339996 95.400002 98.18 103.74 109.85 115.41 121.52 127.63 131.52 137.63 140.69 149.58 155.14 161.25 164.31 170.42 175.98 179.03999 184.60001 190.71001 193.77 198.21001 203.21001 208.77 214.33 217.11 221 227.11 230.082 232.862"
         y="0"
         id="tspan256">Tag børn og voksne legebørn med på en cykeltur, </tspan><tspan
         x="0 6.1100001 11.11 17.219999 21.110001 24.17 26.950001 32.509998 38.619999 41.68 47.790001 53.900002 56.959999 63.07 69.18 73.07 79.18 83.07 89.18 93.07 95.849998 101.96 108.07 113.63 117.52 120.58 125.58 131.14 137.25 141.14 146.7 150.59 153.64999 157.53999 163.64999 169.75999 175.87 179.75999 182.82001 188.92999 197.82001 200.88 206.99001 211.99001 217.55 221.44 225.33"
         y="13"
         id="tspan258">hvor leg og udfordringer venter rundt om hvert </tspan><tspan
         x="0 5.5599999 11.67 17.23 21.120001 25.01 30.57 33.630001 39.740002 42.52 48.630001 52.52 58.630001 64.190002 66.970001 70.029999 76.699997 82.809998 86.699997 89.760002 95.870003 104.76 107.82 113.38 118.94 125.05 128.11 134.22 139.78 142.84 148.95 155.06 160.62 166.17999 170.07001 173.96001 176.74001 179.8 185.91 189.8 195.91 200.91"
         y="26"
         id="tspan260">eneste hjørne. Kør om kap på gokart, prøv </tspan><tspan
         x="0 8.8900003 14.45 20.559999 26.120001 32.23 37.23 43.34 49.450001 55.009998 58.900002 65.010002 70.57 73.629997 79.739998 85.300003 88.360001 94.470001 100.03 106.14 109.2 113.09 116.98 123.09 126.98 132.53999 135.60001 141.71001 147.27 151.16 157.27 161.16 163.94 169.5 175.61 181.17 187.28 190.06 195.62 201.73 205.62 208.39999"
         y="39"
         id="tspan262">megagyngerne på den store naturlegeplads, </tspan><tspan
         x="0 3.8900001 9.4499998 12.51 15.29 21.4 25.290001 29.18 32.240002 38.349998 44.459999 50.57 56.130001 60.02 63.080002 68.080002 70.860001 76.970001 83.080002 88.639999 92.529999 98.639999 104.2 107.26 113.37 118.93 121.99 125.88 131.99001 138.10001 143.66 147.55 151.44 155.33 160.89 169.78 175.89 182 184.78 187.56 193.67 199.23 203.12 209.23 214.78999 217.85001 220.63"
         y="52"
         id="tspan264">få luft under vingerne på supertrampolinerne i </tspan><tspan
         x="0 9.4399996 15 18.889999 21.67 27.23 30.01 35.009998 38.900002 42.790001 45.57 48.630001 54.740002 60.849998 63.91 70.019997 76.129997 80.019997 83.080002 89.190002 98.080002 101.14 107.25 113.36 118.36 124.47 130.58 136.14 138.92 141.7 147.81 153.37 156.42999 160.32001 164.21001 170.32001 174.21001 183.10001 186.99001 189.77 195.88 201.99001 207.55 211.44 214.5 219.5 225.06 231.17"
         y="65"
         id="tspan266">Marielyst, og hør om uhyggelige stormfloder ved </tspan><tspan
         x="0 6.1100001 11.67 17.780001 20.84 26.950001 32.509998 41.400002 44.18 49.740002 52.799999 58.91 65.019997 73.910004 80.019997 85.580002 89.470001 93.360001 98.919998 102.81 105.59 111.7 117.81"
         y="78"

    <text

    <text

       id="text292"><tspan
         x="0 5.5599999 11.12 14.18 19.74 25.299999 31.41 37.52 41.41 46.970001 55.860001 61.419998 64.75 69.190002 74.190002 79.75 85.309998 88.089996 91.980003 98.089996 101.98 107.54 113.65 116.71 122.27 127.27 132.83 138.94 141.72 144.78 148.67 151.45 157.56 161.45 167.56 170.62 176.73 182.84 185.89999 189.78999 195.89999 199.78999 203.67999 206.46001 209.24001 214.8 218.69 224.25"
         y="0"
         id="tspan276">På Panorama-cykelruten ”Fed, fjord og fossiler” </tspan><tspan
         x="0 4.4400001 9.4399996 15 17.780001 23.34 27.23 30.290001 36.400002 42.509998 45.57 49.459999 58.349998 62.240002 65.300003 71.410004 76.970001 80.029999 86.139999 91.699997 95.589996 101.7 105.59 111.15 117.26 121.15 124.21 128.10001 131.99001 138.10001 141.99001 147.55 150.61 156.72 162.83 165.89 169.78 178.67 184.23"
         y="13"
         id="tspan278">cykler du tæt på naturens store og små </tspan><tspan
         x="0 5 7.7800002 13.89 20 26.110001 32.220001 37.779999 41.669998 47.23 50.009998 53.07 60.290001 66.400002 69.18 73.07 76.129997 80.019997 82.800003 85.580002 88.639999 93.639999 99.199997 101.98 105.87 109.76 112.82 118.38 123.94 130.05 133.11 139.22 145.33 148.39 151.17 156.73 162.84 166.73 170.62 176.17999 182.28999 187.85001 190.91 195.91 202.02 208.13 210.91 216.47 222.58 228.69 234.25"
         y="26"
         id="tspan280">vidundere. Højt til vejrs kan du iagttage ynglende </tspan><tspan
         x="0 5 10.56 16.67 22.780001 26.67 32.779999 38.889999 41.669998 47.23 50.290001 55.290001 60.849998 66.959999 70.019997 75.580002 79.470001 88.360001 92.25 96.139999 102.25 105.31 110.31 113.09 119.2 123.09 129.2 131.98 135.03999 141.341 146.901 153.011 156.071 158.851 164.961 168.851 174.961 181.071 186.071 191.631 195.521 199.411 202.19099 207.75101 213.86099 219.42101 225.53101"
         y="39"
         id="tspan282">vandfugle ved Præstø Fjord. Ved jordoverfladen </tspan><tspan
         x="0 5.5599999 11.12 17.23 20.290001 26.4 32.509998 35.57 39.459999 45.57 48.349998 54.459999 60.02 63.080002 69.190002 75.300003 81.410004 87.519997 91.410004 100.3 105.86 111.97 115.86 118.92 122.81 128.92 135.03 138.92 141.98 144.75999 153.64999 159.21001 161.99001 164.77 170.33 179.22 182.28 186.17 191.17 195.06 198.95 204.50999 210.62 219.50999 223.39999"
         y="52"
         id="tspan284">kan du følge hugormens spor imellem tyttebær </tspan><tspan
         x="0 6.1100001 12.22 15.28 21.389999 26.950001 33.060001 38.619999 41.400002 46.400002 52.509998 58.619999 61.400002 64.459999 70.57 76.68 79.739998 85.849998 91.410004 94.470001 100.58 106.14 111.14 116.7 120.59 124.48 127.54 133.64999 139.75999 145.87 151.98 155.03999 160.60001 166.16 172.27 175.33 181.44 187.55 190.61 196.72 202.28 205.34 211.45 217.00999"
         y="65"
         id="tspan286">og hedelyng, og på havets bund kan du gå på </tspan><tspan
         x="0 3.8900001 10 13.89 17.780001 20.559999 23.34 26.120001 31.68 37.790001 41.68 44.740002 50.299999 54.189999 58.080002 63.639999 67.529999 70.589996 76.150002 81.709999 84.769997 93.660004 96.440002 102.55 105.33 108.39 113.95 117.84 120.9 127.01 132.57001 141.46001 144.24001 149.8 152.86 158.97 164.53 167.31 171.2 180.09 186.2 192.31 197.87 201.75999 204.82001 210.92999 213.71001 219.27 225.38 231.49001 235.38"
         y="78"
         id="tspan288">fossiljagt efter 65 mio. år gamle hajtænder blandt </tspan><tspan
         x="0 5.5599999 10.56 16.67 20.559999 26.67 29.450001 35.009998 38.07 41.959999 48.07 53.630001 57.52 60.580002 66.690002 72.800003 75.860001 81.419998 85.309998 88.089996 94.199997 100.31 105.31 108.09 114.2 117.26 122.82 128.38 131.16 136.72"
         y="91"
         id="tspan290">azurblå søer og kridhvid kalk.</tspan></text>

         y="0"
         id="tspan298">Man føler, at man lever livet, som det bør leves, </tspan><tspan
         x="0 6.1100001 11.67 15.56 18.620001 27.51 33.07 39.18 42.240002 46.68 51.68 57.240002 60.02 65.580002 69.470001 72.529999 75.309998 80.870003 86.980003 93.089996 96.980003 100.04 106.15 110.04 115.6 121.71 127.27 130.33 134.22 139.78 145.89 152 155.89 159.78 163.67 169.23 175.34 181.45 187.00999 189.78999 192.85001 198.96001 204.52 210.63 216.74001 222.3 231.19"
         y="13"
         id="tspan300">når man cykler langs brede sandstrande, gennem </tspan><tspan
         x="0 4.4400001 10.55 16.110001 20 28.889999 34.450001 38.34 43.900002 50.009998 56.119999 61.68 64.739998 67.519997 73.080002 79.190002 85.300003 89.190002 95.300003 100.3 105.86 109.75 112.81 121.7 127.26 133.37 136.42999 140.32001 146.42999 155.32001 160.32001 164.21001 169.77 172.83 177.83 183.39 186.17 191.73 194.78999 200.89999 207.00999"
         y="26"
         id="tspan302">charmerende landsbyer med snævre veje og </tspan><tspan
         x="0 3.8900001 7.7800002 11.67 17.23 21.120001 30.01 35.57 39.459999 45.02 48.080002 54.189999 60.299999 64.190002 69.75 72.809998 77.809998 80.870003 86.980003 93.089996 96.150002 105.04 113.93 117.82 123.38 128.94 132.83 135.89 142 147.56 153.67 156.73 162.84 168.39999 171.17999 175.07001 178.13 182.02 188.13 193.69 198.13 200.91 206.47 209.25 212.03 217.59 220.37"
         y="39"
         id="tspan304">stråtækte huse – og mærker den helt specielle, </tspan><tspan
         x="0 5.5599999 9.4499998 13.34 16.120001 21.68 27.790001 33.900002 39.459999 45.57 51.130001 54.189999 60.299999 63.630001 67.519997 71.410004 76.970001 85.860001 91.970001 94.75 100.86 106.97 110.03 116.14 121.7 124.76 129.75999 135.32001 141.42999 147.53999"
         y="52"
         id="tspan306">afslappede ø-stemning på Fanø.</tspan></text>
